class ContextMenu extends HTMLElement{connectedCallback(){const Header=this.attributes.Header?.value||"";setTimeout(()=>this.outerHTML='<div class="fluent-context-menu-container"><a href="#">'+Header+'</a><ul class="fluent-context-menu">'+this.innerHTML+"</ul></div>")}}customElements.define("fluent-contextmenu",ContextMenu);class ContextMenuItem extends HTMLElement{connectedCallback(){const Url=this.attributes.Url?.value||"#";setTimeout(()=>{this.hasAttribute("selectable")?this.outerHTML='<li><a class="fluent-menu-item-select" href="'+Url+'">'+this.innerHTML||"</a></li>":this.outerHTML='<li><a class="fluent-menu-item" href="'+Url+'">'+this.innerHTML||"</a></li>"})}}customElements.define("fluent-contextmenu-item",ContextMenuItem);class Expander extends HTMLElement{connectedCallback(){const Header=this.attributes.Header?.value||"";setTimeout(()=>this.outerHTML='<div style="'+this.style.cssText+'" class="fluent-expander"><div class="fluent-expander-header"><p>'+Header+'</p><div><img class="fluent-expander-arrow" src="./img/arrow_down.svg"></div></div><div class="fluent-expander-body">'+this.innerHTML+"</div></div>")}}customElements.define("fluent-expander",Expander);class Border extends HTMLElement{connectedCallback(){setTimeout(()=>this.outerHTML='<div class="fluent-background-border">'+this.innerHTML+"</div>")}}customElements.define("fluent-border",Border);